        flats: ['D‚ô≠', 'E‚ô≠', 'G‚ô≠', 'A‚ô≠', 'B‚ô≠'],
        sharps: ['C‚ôØ', 'D‚ôØ', 'F‚ôØ', 'G‚ôØ', 'A‚ôØ']
